import React, { Component } from 'react';

class Projects extends Component {
  render() {
    return (
      <div style={{"width":"100%","height":"100vh","backgroundColor":"blue"}}>
        <div class="uk-column-1-2" uk-grid uk-scrollspy="cls: uk-animation-fade; target: > div > .uk-card; delay: 500; repeat: true">
          <div>
              <div class="uk-card uk-card-default uk-card-body">
                  <img data-src="pictures/me.jpg" width="100%" height="100%" alt="" uk-img/>
              </div>
          </div>
          <div>
              <div class="uk-card uk-card-default uk-card-body">
                  <h3 class="uk-card-title">Fade</h3>
                  <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
              </div>
          </div>
        </div>

      </div>
    );
  }
}

export default Projects;
